import manageJss from "@microsoft/fast-jss-manager-react";
import { FlyoutStyles } from "@microsoft/fast-components-styles-msft";
import MSFTFlyout, { FlyoutAxisPositioningMode, FlyoutHorizontalPosition, FlyoutVerticalPosition, } from "./flyout";
import flyoutSchema from "./flyout.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Flyout = manageJss(FlyoutStyles)(MSFTFlyout);
export { Flyout, FlyoutAxisPositioningMode, FlyoutHorizontalPosition, FlyoutVerticalPosition, flyoutSchema, };
